@Test
  public void where_returnsNotNullValue() {
   /* Given */
    UpdateValuesImpl updateValues = new UpdateValuesImpl(new Object[] {1, "test"}, mock(SqlPart.class));

    /* When */
    UpdateWhere result = updateValues.where("a=?", 1);

    /* Then */
    assertThat(result, is(notNullValue()));
  }

